// components/SonhoHistorico.tsx
import { atualizarFavorito, deletarSonho, listarSonhos } from '../libs/db'
import { Sonho } from '../types/sonho'

interface Props {
  sonho: Sonho
  onAtualizar: (sonhos: Sonho[]) => void
}

export function SonhoHistorico({ sonho, onAtualizar }: Props) {
  const atualizar = async () => {
    const lista = await listarSonhos()
    onAtualizar(lista)
  }

  return (
    <div className="mt-4 p-4 border rounded bg-gray-100 space-y-2">
      <p className="italic text-sm">{sonho.texto}</p>
      <p>
        <strong>Interpreta√ß√£o:</strong> {sonho.interpretacao}
      </p>
      <div className="flex gap-2 text-sm">
        <button
          onClick={async () => {
            await atualizarFavorito(sonho.id!, !sonho.favorito)
            atualizar()
          }}
        >
          Favorito ‚≠ê
        </button>
        <button
          onClick={async () => {
            await deletarSonho(sonho.id!)
            atualizar()
          }}
        >
          Excluir üóëÔ∏è
        </button>
      </div>
    </div>
  )
}
